void display_clear()
{
    tft.fillRect(0, 0, 320, 240, ILI9341_WHITE);
}

void display_setup()
{
    tft.begin();
    tft.setRotation(3); // Rotasi layar (0 - 3 untuk orientasi)
    tft.fillScreen(ILI9341_BLACK);
}

void display_booting()
{
    display_clear();
    // Intro Logo UNNES
    tft.drawRGBBitmap(0, 0, myBitmapUnnes, 320, 240);
    delay(2000);

    display_clear();
    // Intro Logo BABAT
    tft.drawRGBBitmap(0, 0, myBitmapBABAT, 320, 240);
    delay(2000);
}

